import React, { Component } from 'react'
//import FullWidthGrid from '../Coponent/layout'
import Navibar from '../Coponent/Navibar';
import Paper from '@material-ui/core/Paper';
import Grid from '@material-ui/core/Grid';
import GuestInfo from '../Coponent/Personalinfo';
import useStyles from '../Coponent/useStyles';
import PropertyDetail from '../Coponent/PropertyDetail';
import PaymentDetail from '../Coponent/PaymentDetail';
import Paypal from '../Coponent/Paypal';


export default class Booking extends Component {
    constructor(props){
        super(props)
        //console.log(this.props)
        this.state={
            slug:this.props.match.params.slug
        };
    }
    render(){
        console.log(this.props.r)
        return (
            
            <div className="back-ground">
                <Navibar loggedinstatus={this.props.loggedinstatus}/>   
        <div className="main">
            <h2>Your Booking details</h2>
            
            <Grid container spacing={1}>
                <Grid item xs={12} sm={12}>
                <Paper >
                <div >
                    <h5>STEP 1: Check Yor Room information</h5>
                    
                    <div className="propertycheck">
                        <p>Room Name:  </p>
                        
                        <h5>{this.props.r.name}</h5>
                        <br></br>
                        <p>Room type:</p>
                        
                        <h5>{this.props.r.type}</h5>
                        <br></br>
                        <p>Room capacity:</p>
                        <h5>{this.props.r.capacity}</h5>
                    </div>
                </div></Paper>
                </Grid>
                <Grid item xs={12} sm={12}>
                <Paper>
                    <h5>STEP 2: Please Input Check-in details</h5>
                    <GuestInfo/>
                    </Paper>
                </Grid>
                <Grid item xs={12} sm={12}>
                <Paper> 
                <div >
                    <h5>STEP 3: Check Payment details</h5>
                    <PaymentDetail></PaymentDetail>
                </div></Paper>
                </Grid>
            </Grid>
            </div>
            <div className="paypal">
                <Paypal />
            </div> 
        </div>
        
        );
    }
}
